import { MD5 } from 'crypto-js';

const nodeEnv = process.env.NODE_ENV || 'development';

export default class Env {

  static publicKey = nodeEnv === 'development' ? 'b50abba380e2d7526a8f2976d414d3ad' : process.env.PUBLIC_KEY;
  static privateKey = nodeEnv === 'development' ? 'fb169aa00e7df048c545f2f3b05f9b5317bde1b1' : process.env.PRIVATE_KEY;
  static ts = new Date().getTime();
  static hash = MD5(ts + Env.privateKey + Env.publicKey);

}
